import React from 'react';

const Column3D = ({chartData}) => {
  const chartConfigs = {
    type: 'pie3d',
    width: '100%',
    // height: '100%',
    dataFormat: 'json',
    dataSource: {
      "chart": {
        "caption": "Languages",
        "subCaption": "Most Popular",
        "theme": "fusion",
        "decimals": "0"
      },
      "data": chartData
    },
  };
  return <ReactFC {...chartConfigs} />;
}

export default Column3D;


